import React, { useContext } from 'react';
import { AuthContext } from '../context/AuthContext';

const AuthDebug = () => {
  const { currentUser } = useContext(AuthContext);

  const localStorageUser = localStorage.getItem('user');
  let parsedUser = null;

  try {
    if (localStorageUser) {
      parsedUser = JSON.parse(localStorageUser);
    }
  } catch (e) {
    console.error("Error parsing user from localStorage:", e);
  }

  const debugStyle = {
    position: 'fixed',
    bottom: '10px',
    right: '10px',
    backgroundColor: 'rgba(0,0,0,0.7)',
    color: 'white',
    padding: '10px',
    borderRadius: '5px',
    fontSize: '12px',
    maxWidth: '300px',
    maxHeight: '200px',
    overflow: 'auto',
    zIndex: 9999
  };

  return (
    <div style={debugStyle}>
      <h4>Auth Debug</h4>
      <p><strong>Context User:</strong> {currentUser ? 'Yes' : 'No'}</p>
      {currentUser && (
        <div>
          <p>Username: {currentUser.username}</p>
          <p>Token: {currentUser.token ? currentUser.token.substring(0, 10) + '...' : 'None'}</p>
        </div>
      )}
      <p><strong>LocalStorage User:</strong> {parsedUser ? 'Yes' : 'No'}</p>
      {parsedUser && (
        <div>
          <p>Username: {parsedUser.username}</p>
          <p>Token: {parsedUser.token ? parsedUser.token.substring(0, 10) + '...' : 'None'}</p>
        </div>
      )}
    </div>
  );
};

export default AuthDebug;
